import React from "react";

const Else = (props) => {
    
    return(
        <>
             <div className="slot">
          <h1 style={{fontSize:'x-large'}} >{x = prop} {y} {z}</h1>
          <h1 style={{fontSize:'large'}} >This is not matching</h1>
          {/* <hr/> */}
          </div>
          </>
    );
}

export default Else;
